import React, { Component } from 'react'

export default class state extends Component {

  constructor(props){
    super(props)

    this.state = {
      count : 0
    }
  }
  render() {
    return (
      <div>
        <button onClick={()=>{ this.setState.count = this.state.count} }>Click {this.state.count}</button>
      </div>
    )
  }
}
